import React from 'react'

const Footer = () => {
  return (
    <div
      style={{
        backgroundColor: '#ddd',
        position: 'fixed',
        padding: '2em',
        width: '100%',
        bottom: '0',
        transform: 'translate(0, 0)',
      }}>
      Footer
    </div>
  )
}

export default Footer
